import { Button, Grid, Stack } from "@mui/material";

export const Content = () => {
  return (
    <Grid container>
      <Grid item>
        <Stack direction={"row"}>
          <Button>Up vote</Button>
          <Button>Down vote</Button>
          <Button>Up vote</Button>
          <Button>Down vote</Button>
        </Stack>
      </Grid>
    </Grid>
  );
};
